import { createRouter, createWebHashHistory } from 'vue-router'
// import HomeView from '../views/HomeView.vue'
import products from '@/modules/daybook/router/index'


const routes = [
  {
    path: '/',
    name: 'home',
    component: products
  },

  {
    path: '/shopcar',
    name: 'shopcar',
    component: () => import(/* webpackChunkName: "about" */ '@/modules/daybook/components/ShopCar.vue')
  },

  {
    path: '/products',
    ...products
  }


]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
